__NUXT_JSONP__("/works", (function(a,b,c,d,e,f,g,h,i,j,k,l,m){return {data:[{works:{contents:[{id:d,createdAt:"2022-01-02T11:33:10.320Z",updatedAt:a,publishedAt:a,revisedAt:a,title:"株式会社nozopico \u002F LOGO DESIGN",slug:d,release:e,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F225cc6c2cf2447838dd9fe9e6e8facdf\u002F00nozopico-logo_1.png",height:b,width:c},overview:"株式会社nozopico様のロゴを制作させていただきました。\n\n「pico=ピコッ」という語感をヒントに、多くの人々のきっかけになるスイッチをイメージ。\nビックリマークは、人のさまざまな感情を表しており、豊かで生き生きとした「生き方」と「働き方」を表現。\nまた右上へと駆け上がる形は、これから進む未来を示しています。\n\nロゴを使用する媒体によって、自由なバリエーションから選ぶことができます。",url:f,responsibility:[g]},{id:h,createdAt:i,updatedAt:j,publishedAt:i,revisedAt:j,title:"のぞみバー \u002F First Anniversary Goods",slug:h,release:"2020-11-30T15:00:00.000Z",thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F3b9bc3f0b9df40b0a3e592113176cd6e\u002F0nozomibar-goods_2.png",height:b,width:c},overview:"のぞみバー様の1周年記念のデザインを制作させていただきました。\n\nバーに猫も寄ってくるというエピソードを元にイメージ作成しました。\nジョージアの公用語であるグルジア語で「のぞみバー」という表記が入っています。\n丸みのある可愛らしい形の文字です。\n\n↓ 下記URLのSUZURIからさまざまなグッズが購入できます。",url:"https:\u002F\u002Fsuzuri.jp\u002FNozomiBar",responsibility:[g]},{id:k,createdAt:l,updatedAt:m,publishedAt:l,revisedAt:m,title:"株式会社nozopico \u002F NAME CARD",slug:k,release:e,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F9b3c7fe1e61e4643815dac3469500de5\u002F0nozopico-namecard_1.jpg",height:b,width:c},overview:"株式会社nozopico様の名刺を制作させていただきました。",url:f,responsibility:[]}],totalCount:3,offset:0,limit:10}}],fetch:{},mutations:void 0}}("2022-01-03T11:11:55.577Z",500,800,"29agpom-_a3","2019-04-30T15:00:00.000Z","https:\u002F\u002Fnozomicoaching.com\u002F","Design","ihlf69az_xmf","2022-01-02T02:20:08.612Z","2022-01-03T11:07:50.812Z","vnw2mwzla9","2022-01-02T10:31:30.279Z","2022-01-03T11:08:54.404Z")));